import React from 'react';
import ReactDOM from 'react-dom/client';
import './main.css';

const App = () => {
  return (
    <div>
      <h1>Welcome to the Car Rental Admin Dashboard</h1>
    </div>
  );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
